import logo from './logo.svg';
import './App.css';

import Home from "./pages/Home/Home";
import About from "./pages/About/About";
import { Link } from 'react-router-dom';

function App() {
  return (
    <div>
      <nav>
        <Link to="/About">About</Link>
      </nav>
      <Outlet />
      <Home />
    </div>

  );
}

export default App;
